	(36,X'66756E632D41776F415944394677534C554D5277544E71567A764A','水位检测','水位检测，用于检测连续频繁的异常点，对于偶发的突变点不敏感\n参数如下：\n    1. trigger_info {dict} 异常检测规则（以前叫触发器）的基本信息，结构如下：\n        {\n          \"uuid\"          : \"str, <UUID> 即规则ID\",\n          \"name\"          : \"str, <名称> 即规则名称\",\n          \"workspaceToken\": \"str, <工作空间令牌> 用于判断出事件之后写入__keyevent\",\n          \"dimensions\"    : \"<触发维度> list类型，元素为str\"\n        }\n\n    2. targets {list} 检测的目标，结构如下：\n        [\n          {\n            \"alias\"     : \"str, <别名> 默认即M1, M2 ...，用户可以改为其他内容，用于各类告警文案、数据填充\",\n            \"influxQL\"  : \"str, <InfluxDB 查询语句>\", 注：实际查询时需 替换占位符（$now) 为当前的时刻;\n                            注：influxQL里，where的时间窗里面，取 $now - （聚合周期个数+100）* 聚合周期 到 $now 的数据\",\n            \"qtype\"     : \"str, 如http，注：该字段内容算法用不上，只是当写入keyevennt时原封不动一并传入\",\n            \"query\"     : {\"注：该字段内容算法用不上，只是当写入keyevennt时一并传入，目的是使前端可以拉取keyevent同时也能根                                        据query获取原始的时序数据。该字段结构由后端和前端一起定义\"}\n          }\n        ]\n\n    3. condition_check_setting {dict} 异常检测的触发条件配置，结构如下，分为检测规则和告警动作：\n        {\n          \"rules\": [\n          {\n            \"triggerCondition\": {\n                \"periodNum\": \"int, 检测几个聚合周期，实际就是检测最近的多少个点\",\n                \"strength\": \"int, 检测的强度，目前页面上可选强，中，弱，传过来是数字3，2，1，强度越高代表异常的判定越苛刻\",\n                \"direction\": \"str, 检测的方向, 页面上三个单选项对应的是 up, down, both\",\n                \"checkCount\": \"int, 当连续的异常点数>=该值时，触发事件\"\n            },\n            \"level\": \"str, 异常级别，目前默认 warning，写死\"\n        }],\n          \"actions\": [\n            {\n              \"type\"   : \"mail\",\n              \"to\"     : [\"邮件地址1\", \"邮件地址2\"],\n              \"title\"  : \"<邮件标题>\",\n              \"content\": \"<邮件内容>\"\n            },\n            {\n              \"type\"    : \"dingTalkRobot\",\n              \"webhook\" : [\"钉钉机器人调用地址1\", \"钉钉机器人调用地址2\"],\n              \"title\"   : \"<通知标题>\",\n              \"markdown\": \"<MarkDown格式通知内容>\"\n            },\n            {\n              \"type\"   : \"ProfWangAlertHub\",\n              \"url\"    : [\"王教授AlertHub调用地址1\", \"王教授AlertHub调用地址2\"],\n              \"title\"  : \"<情报标题>\",\n              \"content\": \"<情报内容>\"\n            },\n            {\n              \"type\"    : \"HTTPRequest\",\n              \"url\"     : [\"请求地址1\", \"请求地址2\"],\n              \"method\"  : \"<请求方式> GET|POST\",\n              \"headers\" : {\"Header1\": \"HeaderValue1\", \"Header2\": \"HeaderValue2\"},\n              \"body\"    : \"<method=POST 请求体>\",\n              \"bodyType\": \"<method=POST 请求体类型> text|json|form\"\n            },\n            {\n              \"type\"            : \"DataFluxFunc\",\n              \"scriptSetRefName\": \"<脚本集引用名>\",\n              \"scriptRefName\"   : \"<脚本引用名>\",\n              \"funcRefName\"     : \"<函数名>\",\n              \"kwargs\"          : { \"<调用参数名>\": \"<调用参数值>\" }\n            }\n          ]\n        }\n\n    4. all_time:  \"dict, 检测频率，数据聚合的周期\"\n        {\n            \"every_time\": \"str, 每隔多久检测一次\",\n            \"group_time\": \"str, 时间聚合周期\",\n        }\n\n    5. extra_alert_tags: {dict} 额外添加的告警数据标签\n        {\n            \"extra_alert_tags\": \"str, 异常\"\n        }',X'737365742D66745F6C6962',X'736370742D6C6576656C5F73686966745F63686B',X'6C6576656C5F73686966745F636865636B',X'6C6576656C5F73686966745F636865636B28747269676765725F696E666F2C20746172676574732C20636F6E646974696F6E5F636865636B5F73657474696E672C20616C6C5F74696D652C2065787472615F616C6572745F746167733D4E6F6E6529','[\"trigger_info\", \"targets\", \"condition_check_setting\", \"all_time\", \"extra_alert_tags\"]','{\"targets\": {}, \"all_time\": {}, \"trigger_info\": {}, \"extra_alert_tags\": {\"default\": null}, \"condition_check_setting\": {}}','{\"isHidden\": true}','builtinCheck',NULL,0,'2020-08-03 01:05:22','2020-10-15 09:40:30.245165'),
	(37,X'66756E632D34395A4764414D756A507153647A43766E3459796A52','区间检测','区间检测，利用历史数据预测出数据点的上下区间，超出区间外的为异常点\n参数如下：\n    1. trigger_info {dict} 异常检测规则（以前叫触发器）的基本信息，结构如下：\n        {\n          \"uuid\"          : \"str, <UUID> 即规则ID\",\n          \"name\"          : \"str, <名称> 即规则名称\",\n          \"workspaceToken\": \"str, <工作空间令牌> 用于判断出事件之后写入__keyevent\",\n          \"dimensions\"    : \"<触发维度> list类型，元素为str\"\n        }\n\n    2. targets {list} 检测的目标，结构如下：\n        [\n          {\n            \"alias\"     : \"str, <别名> 默认即M1, M2 ...，用户可以改为其他内容，用于各类告警文案、数据填充\",\n            \"influxQL\"  : \"str, <InfluxDB 查询语句>\", 注：实际查询时需 替换占位符（$now) 为当前的时刻;\n                            注：influxQL里，where的时间窗里面，取 $now - （聚合周期个数+100）* 聚合周期 到 $now 的数据\",\n            \"qtype\"     : \"str, 如http，注：该字段内容算法用不上，只是当写入keyevennt时原封不动一并传入\",\n            \"query\"     : {\"注：该字段内容算法用不上，只是当写入keyevennt时一并传入，目的是使前端可以拉取keyevent同时也能根                                        据query获取原始的时序数据。该字段结构由后端和前端一起定义\"}\n          }\n        ]\n\n    3. condition_check_setting {dict} 异常检测的触发条件配置，结构如下，分为检测规则和告警动作：\n        {\n          \"rules\": [\n          {\n            \"triggerCondition\": {\n                \"periodNum\": \"int, 检测几个聚合周期\",\n                \"strength\": \"int, 检测的强度，目前页面上可选强，中，弱，传过来是数字3，2，1，强度越高代表异常的判定越苛刻\",\n                \"direction\": \"str, 检测的方向, 页面上三个单选项对应的是 up, down, both\",\n                \"checkPercent\": \"int，1-100，当异常点数百分比 >= 该值时，触发事件\"\n            },\n            \"level\": \"str, 异常级别，目前默认 warning，写死\"\n        }],\n          \"actions\": [\n            {\n              \"type\"   : \"mail\",\n              \"to\"     : [\"邮件地址1\", \"邮件地址2\"],\n              \"title\"  : \"<邮件标题>\",\n              \"content\": \"<邮件内容>\"\n            },\n            {\n              \"type\"    : \"dingTalkRobot\",\n              \"webhook\" : [\"钉钉机器人调用地址1\", \"钉钉机器人调用地址2\"],\n              \"title\"   : \"<通知标题>\",\n              \"markdown\": \"<MarkDown格式通知内容>\"\n            },\n            {\n              \"type\"   : \"ProfWangAlertHub\",\n              \"url\"    : [\"王教授AlertHub调用地址1\", \"王教授AlertHub调用地址2\"],\n              \"title\"  : \"<情报标题>\",\n              \"content\": \"<情报内容>\"\n            },\n            {\n              \"type\"    : \"HTTPRequest\",\n              \"url\"     : [\"请求地址1\", \"请求地址2\"],\n              \"method\"  : \"<请求方式> GET|POST\",\n              \"headers\" : {\"Header1\": \"HeaderValue1\", \"Header2\": \"HeaderValue2\"},\n              \"body\"    : \"<method=POST 请求体>\",\n              \"bodyType\": \"<method=POST 请求体类型> text|json|form\"\n            },\n            {\n              \"type\"            : \"DataFluxFunc\",\n              \"scriptSetRefName\": \"<脚本集引用名>\",\n              \"scriptRefName\"   : \"<脚本引用名>\",\n              \"funcRefName\"     : \"<函数名>\",\n              \"kwargs\"          : { \"<调用参数名>\": \"<调用参数值>\" }\n            }\n          ]\n        }\n\n    4. all_time:  \"dict, 检测频率，数据聚合的周期\"\n        {\n            \"every_time\": \"str, 每隔多久检测一次\",\n            \"group_time\": \"str, 时间聚合周期\",\n        }\n\n    5. extra_alert_tags: {dict} 额外添加的告警数据标签\n        {\n            \"extra_alert_tags\": \"str, 异常\"\n        }',X'737365742D66745F6C6962',X'736370742D72616E67655F63686B',X'72616E67655F636865636B',X'72616E67655F636865636B28747269676765725F696E666F2C20746172676574732C20636F6E646974696F6E5F636865636B5F73657474696E672C20616C6C5F74696D652C2065787472615F616C6572745F746167733D4E6F6E6529','[\"trigger_info\", \"targets\", \"condition_check_setting\", \"all_time\", \"extra_alert_tags\"]','{\"targets\": {}, \"all_time\": {}, \"trigger_info\": {}, \"extra_alert_tags\": {\"default\": null}, \"condition_check_setting\": {}}','{\"isHidden\": true}','builtinCheck',NULL,0,'2020-08-03 01:05:22','2020-10-15 09:40:30.245165'),
